//生成ボタンを押したときに実行する関数
function get_result(){
    //設定内容の読み取り
    let gender = document.getElementById("gender").value;
    let country = document.getElementById("country").value;
    let count = document.getElementById("count").value;

    //名前を入れる箱
    let name_list = [];
    for(let i = 0; i < count; i++)
    {
        //設定内容をもとに生成した名前を配列に入れる
        name_list.push(getName(gender, country));
    }

    //結果の場所の取得
    let myParagraph = document.getElementById("result_list");
    let dummy_text = '';
    for(let i=0; i<name_list.length; i++)
    {
        //HTML形式のリストの中に、名前の配列を入れる
        dummy_text += '<li class="result">' + name_list[i] + '</li>';
    }
    myParagraph.innerHTML = dummy_text;
}

//ページ起動時に呼び出される関数
window.onload = function()
{
    //設定画面の場所の取得
    let myParagraph = document.getElementById("setting_table");
    //HTMLのテーブル形式に、設定の選択肢情報のObjectから構築
    let dummy_text = '<table class="setting">';
    for(let i=0; i < table_data.data.length; i++)
    {
        dummy_text += '<tr><td class="setting">' + table_data.data[i].text + '</td><td>';
        dummy_text += '<select  class="setting" id="'+table_data.data[i].id+'">';
        for(let j=0; j<table_data.data[i].data.length; j++)
        {
            dummy_text += '<option value="'+table_data.data[i].data[j]+'">'+table_data.data[i].data[j]+'</option>';
        }
        dummy_text += '</select></td>';
    }
    dummy_text += '</table>';
    myParagraph.innerHTML = dummy_text;
    
}

