//配列からランダムな要素を一つ抽出
function getDataFromList(list)
{
    let random_num = Math.floor(Math.random() * list.length);
    return list[random_num];
}

function getName(gender, country)
{
    let name = "";
    let n = randomRange(1,10);
    //名前の言語など種類ごとに処理
    switch(country)
    {
        case "日本語":
            //1割の確率で１文字の名字を選択：そうでない場合組み合わせで名字を生成
            if(n<2){name += getDataFromList(name_data.日本語.last_1)}
            else
            {
                name += getDataFromList(name_data.日本語.last_2a);
                name += getDataFromList(name_data.日本語.last_2b);
            }
            //1割の確率で１文字の名前を選択：そうでない場合組み合わせで名前を生成
            n = randomRange(1,10);
            name += " ";
            //性別ごとに処理
            if(gender=="男性")
            {
                if(n<2){name += getDataFromList(name_data.日本語.first_m_1)}
                else
                {
                    name += getDataFromList(name_data.日本語.first_m_2a);
                    name += getDataFromList(name_data.日本語.first_m_2b);
                }
            }
            else
            {
                if(n<2){name += getDataFromList(name_data.日本語.first_f_1)}
                else
                {
                    name += getDataFromList(name_data.日本語.first_f_2a);
                    name += getDataFromList(name_data.日本語.first_f_2b);
                }
            }
            break;
            case "英語English":
                if(gender=="男性")
                {
                    name += getDataFromList(name_data.英語English.first_m_2a);
                    name += getDataFromList(name_data.英語English.first_m_2b);
                }
                else
                {
                    name += getDataFromList(name_data.英語English.first_f_2a);
                    name += getDataFromList(name_data.英語English.first_f_2b);
                }
                name += " ";
                name += getDataFromList(name_data.英語English.last_2a);
                name += getDataFromList(name_data.英語English.last_2b);
                break;
                case "英語":
                    if(gender=="男性")
                    {
                        name += getDataFromList(name_data.英語.first_m_2a);
                        name += getDataFromList(name_data.英語.first_m_2b);
                    }
                    else
                    {
                        name += getDataFromList(name_data.英語.first_f_2a);
                        name += getDataFromList(name_data.英語.first_f_2b);
                    }
                    name += "・";
                    name += getDataFromList(name_data.英語.last_2a);
                    name += getDataFromList(name_data.英語.last_2b);
                    break;
    }
    return name;
}

// min ~ max の範囲の整数を返す
function randomRange(min, max)
{
    return min + Math.floor((max - min + 1) * Math.random());
}

